import React from 'react'
import styled from 'styled-components';
import './WhoComponent.css';

const Section = styled.div`
height:100vh;
background-color:red;
scroll-snap-align:center;
overflow: hidden;
`;

const ParallaxContainer=styled.div`
display: flex;
flex-direction: column;
height: 100vh;
overflow-y: auto;
`

const ParallaxImage=styled.div`
display: flex;
flex-direction: column;
height: 100vh;
overflow-y: auto;
`



const WhoComponent = () => {

  return (
    <Section>
      <ParallaxContainer>
        <div class="parallax-image" style="background-image: url(../../../Assets/image1.jpg);"></div>
        <div class="parallax-image" style="background-image: url(../../../Assets/image2.jpg);"></div>
        <div class="parallax-image" style="background-image: url(../../../Assetsimage3.jpg);"></div>
        <div class="parallax-image" style="background-image: url(../../../Assetsimage4.jpg);"></div>
      </ParallaxContainer>
    </Section>
  )
}

export default WhoComponent
